import React from "react";
import ReactDOM from "react-dom";
import App from "./app";
import { BrowserRouter, Redirect, Route, Switch } from "react-router-dom";
import Individual_Bank from "./Individual_Bank_Details/individual_Bank";
import Favourites from "./Favourites/favourites";

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <Switch>
        <Route exact path="/">
          <Redirect to="/all-banks" />
        </Route>
        <Route exact path="/all-banks" component={App} />
        <Route exact path="/favourites" component={App} />
        {/* <Route exact path="/Favourites" component={Fav} /> */}
        <Route exact path="/bank-details/:ifsc" component={Individual_Bank} />
      </Switch>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById("root")
);
